static std::unique_ptr<MODEL_INFO_MAP> s_ModelInfoMap;

const NGSPICE::MODEL_INFO& NGSPICE::ModelInfo( MODEL_TYPE aType )
{
    if( !s_ModelInfoMap )
        s_ModelInfoMap = std::make_unique<MODEL_INFO_MAP>();

    return s_ModelInfoMap->modelInfos.at( aType );
}
